
CREATE TABLE Service(
	Service_Id int  auto_increment,
	Title varchar(50) NOT NULL,
	Description varchar(250) NOT NULL,
	Status varchar(50) NOT NULL,
	Inserted_By int NOT NULL,
	Inserted_Date datetime NOT NULL,
	Updated_By int NULL,
	Updated_Date datetime NULL,
	Deleted_By int NULL,
	Deleted_Date datetime NULL,
	Parent_Service_Id int NULL,
	Measuring_Unit_Id int NULL,
	msrepl_tran_version varchar(250) NOT NULL,
	rowguid varchar(250) NOT NULL,
    PRIMARY KEY (`Service_Id`)
);

CREATE TABLE Service_Charges(
	Service_Charges_Id int auto_increment NOT NULL,
	Measuring_Unit_Id int NOT NULL,
	Service_Id int NOT NULL,
	Client_Type_Id int NOT NULL,
	Title varchar(50) NOT NULL,
	Description varchar(250) NOT NULL,
	Status nchar(10) NOT NULL,
	inserted_by nchar(20) NOT NULL,
	inserted_date datetime NOT NULL,
	updated_by nchar(20) NOT NULL,
	updated_date datetime NOT NULL,
	deleted_by nchar(20) NOT NULL,
	deleted_date datetime NOT NULL,
	Applicable_Date datetime NULL,
	Expiry_Date datetime NULL,
	msrepl_tran_version varchar(250) NOT NULL,
    primary key(Service_Charges_Id)
);

CREATE TABLE Service_Charges_Detail(
	Service_Charges_Detail_Id int  auto_increment NOT NULL,
	Service_Charges_Id int NOT NULL,
	First_Value int NOT NULL,
	Last_Value int NOT NULL,
	Charges int NULL,
	Additional_Value int NULL,
	Additional_Charge int NULL,
	Status varchar(50) NULL,
	Seed bit NOT NULL,
	Service_Charges_Location_Detail_Id int NULL,
	IsMerchandise int NULL,
	msrepl_tran_version varchar(250) NOT NULL,
	rowguid varchar(250) NOT NULL,
    primary key(Service_Charges_Detail_Id)
 );


CREATE TABLE Service_Charges_Location_Detail(
	Service_Charges_Location_Detail_Id int auto_increment NOT NULL,
	Service_Charges_Detail_Id int NOT NULL,
	To_Location_ID int NOT NULL,
	From_Location_Id int NOT NULL,
	Charges int NULL,
	Additional_Charges int NULL,
	Status varchar(50) NOT NULL,
	Applicable_Date datetime NULL,
	Expiry_Date datetime NULL,
	msrepl_tran_version varchar(250) NOT NULL,
	rowguid varchar(250) NOT NULL,
    primary key(Service_Charges_Location_Detail_Id)
 );


